// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract Marketplace {
    struct Product {
        uint256 id;
        string name;
        uint256 price;
        address seller;
        bool isAvailable;
    }

    enum OrderStatus { Pending, Paid, Confirmed, Shipped, Delivered, Cancelled }

    struct Order {
        uint256 id;
        address buyer;
        uint256 productId;
        OrderStatus status;
        uint256 deadline;
    }

    // Events
    event ProductAdded(uint256 indexed productId, string name, uint256 price, address seller);
    event OrderCreated(uint256 indexed orderId, address indexed buyer, uint256 indexed productId, uint256 amount);
    event OrderStatusUpdated(uint256 indexed orderId, OrderStatus newStatus);
    event OrderCancelled(uint256 indexed orderId, address indexed buyer, uint256 refundAmount);

    // State variables
    Product[] public products;
    mapping(uint256 => Product) public productById;
    mapping(uint256 => Order) public orders;
    mapping(uint256 => uint256) private orderPayments; // Track payments per order
    uint256 private orderNonce;

    // Add a product to the marketplace
    function addProduct(string memory name, uint256 price) external {
        uint256 productId = products.length;
        products.push(Product({
            id: productId,
            name: name,
            price: price,
            seller: msg.sender,
            isAvailable: true
        }));
        productById[productId] = products[productId];
        emit ProductAdded(productId, name, price, msg.sender);
    }

    // Create a new order (payable)
    function createOrder(uint256 productId) external payable {
        require(productById[productId].isAvailable, "Product not available");
        require(msg.value == productById[productId].price, "Incorrect payment amount");

        uint256 orderId = uint256(keccak256(abi.encode(msg.sender, productId, block.timestamp, orderNonce++)));

        orders[orderId] = Order({
            id: orderId,
            buyer: msg.sender,
            productId: productId,
            status: OrderStatus.Paid, // Auto-set to Paid since payment is made
            deadline: block.timestamp + 1 hours
        });

        orderPayments[orderId] = msg.value;
        productById[productId].isAvailable = false; // Mark product as sold
        emit OrderCreated(orderId, msg.sender, productId, msg.value);
    }

    // Update order status with validation
    function updateOrderStatus(uint256 orderId, OrderStatus newStatus) external {
        Order storage order = orders[orderId];
        require(msg.sender == order.buyer || msg.sender == productById[order.productId].seller, "Unauthorized");
        require(block.timestamp <= order.deadline, "Order expired");
        require(isValidTransition(order.status, newStatus), "Invalid status transition");

        if (newStatus == OrderStatus.Cancelled) {
            // Refund the buyer
            uint256 refundAmount = orderPayments[orderId];
            payable(order.buyer).transfer(refundAmount);
            productById[order.productId].isAvailable = true; // Make product available again
            emit OrderCancelled(orderId, order.buyer, refundAmount);
        }

        order.status = newStatus;
        emit OrderStatusUpdated(orderId, newStatus);
    }

    // Validate status transitions
    function isValidTransition(OrderStatus current, OrderStatus newStatus) public pure returns (bool) {
        return
            (current == OrderStatus.Pending && newStatus == OrderStatus.Paid) ||
            (current == OrderStatus.Paid && (newStatus == OrderStatus.Confirmed || newStatus == OrderStatus.Cancelled)) ||
            (current == OrderStatus.Confirmed && newStatus == OrderStatus.Shipped) ||
            (current == OrderStatus.Shipped && newStatus == OrderStatus.Delivered) ||
            (current == OrderStatus.Pending && newStatus == OrderStatus.Cancelled);
    }

    // Update product name and price (only seller can update)
    function updateProductName(uint256 productId, string memory newName, uint256 newPrice) external {
        require(productById[productId].seller == msg.sender, "Only seller can update");
        productById[productId].name = newName;
        productById[productId].price = newPrice;
    }
}

